let style5 = {visibility: 'hidden'}
let style6 = {visibility: 'hidden'}
let style7 = {visibility: 'hidden'}
let style8 = {visibility: 'hidden'}
let style9 = {visibility: 'hidden'}
let style10 = {visibility: 'hidden'}

class SpectreTopBar extends Component {

    render() {
      fleche = (
        <div className={classes.spectreTool}>
          <div className={classes.fleche} style={style1}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style2}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style3}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style4}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style5}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style6}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style7}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style8}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style9}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style20}>
            <Icon icon={caretUp} size={20}/>
          </div>
        </div>
      )

      return (        
        <div className={classes.SpectreTopBar}>
          <div className={classes.spectreImg}>
            <img src={spectreVide} alt="vide" className={classes.image} />
          </div>
            {fleche}
        </div>
      );
    }
  }

export default Radium(SpectreTopBar);
